import BordContainer from './BordContainer';

function ContentContainer(props) {

  const style = {
    width: "100%",
    height: "100%",
    background: "blue"
  };

  return (
    <div className="contentContainer" style={style}>
      <BordContainer />
    </div>
  );
}

export default ContentContainer;
